import React from "react";
import SignUp from "../components/signUp";

const Account = () => {
  const isUserLoggedIn = false;
  return (
    <>
      <div className="main-container">
        {isUserLoggedIn ? <h1>Account Page</h1> : <SignUp />}
      </div>
    </>
  );
};

export default Account;
